import React from 'react';
import "./Login.scss";
import logoimg from "../../Assets/Engame_logo.png";

function LoginPage() {
  return (
    <div className='login_box'>
      <div className='lb_imgbox'>
        <img src={logoimg}/>
      </div>
      <div className='lb_body'>
        <div className='lb_error_msg'>Invalid Credentials</div>
        <input className='lb_inputclass' type="text" placeholder='Username' autoComplete='false'/>
        <input className='lb_inputclass' type="password" placeholder='Password' autoComplete='false'/>
        <button className='login_btn'>Login</button>
      </div>
    </div>
  )
}

export default LoginPage
